import React from 'react';
import './DataVisualization.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/img/statewise_distribution.png';
import '../assets/img/statewise_accuracy.png';

const DataVisualization = () => {
  return (
    <div className="dashboard">
      <div className="translucent-container">
        <div className="box rectangular-plot">
          <img src = {require('../assets/img/statewise_distribution.png')} alt="Statewise Distribution" />
        </div>
        <div className="box">
          <h2>Plot 2</h2>
        </div>
        <div className="box">
          <h2>Plot 3</h2>
        </div>
        <div className="box text-content"> 
          <h2>Text Content</h2>
          <p>Any other information ig?</p>
        </div>
      </div>
    </div>
  );
};

export default DataVisualization;
